const Store = require('mongoose').model('Store')

module.exports.create = (req, res, next) => {
  if (!req.body.name) {
    return next(new Error('Produce name is required'))
  }
  if (!req.body.description) {
    return next(new Error('Produce description is required'))
  }
  if (!req.body.price) {
